const router = createBrowserRouter([
  {
    path: '',
    element: <RootLayout />
  },
  {
    path: '/',
    element: <HomePage />
  }, {
    path: '/products',
    element: <Products />
  }]);




const App = () => {
  return <RouterProvider router={router} />
};

export default App;
